import React from "react";

import searchButton from '../../img/icon-4.svg';
import vector3 from '../../img/vector-3.svg';
import Locations from './Locations';
import SidePanel from './SidePanel';
import { Component } from "../../components/Component";


const Panel = ({ text }) => ( 
  <div className="relative w-[142px] h-[47px]">
    <div className="relative w-[140px] h-[47px] bg-[#d9d9d940] rounded-[23.5px]">
      <img className="h-1.5 top-[22px] left-28 absolute w-[11px]" alt="Vector" src={vector3} />
      <div className="absolute h-6 top-3 left-5 text-[#2a2a33] text-sm font-light">
        {text}
      </div>
    </div>
  </div>
);

export const CompareProperty = () => {
  return (

    <div className="bg-white flex flex-row justify-center w-full py-6">
  <div className="bg-white w-full max-w-[1440px] h-auto flex items-center justify-between px-6">
    {/* Search & Compare Title */}
    <div className="flex items-center">
      <h1 className="text-black font-semibold text-2xl">Search & Compare</h1>
    </div>

    {/* Search bar */}
    <div className="relative flex items-center gap-4">
      <div className="flex items-center bg-gray-100 w-[250px] h-[50px] rounded-full px-4 shadow-sm">
        <input
          className="flex-grow bg-transparent outline-none text-sm text-black"
          placeholder="Search..."
        />
        <img className="w-5 h-5 cursor-pointer" alt="Search Icon" src={searchButton} />
      </div>

      {/* Filters */}
      <div className="flex items-center gap-4">
        {['Amenities', 'Square Feet', 'Leasing End Date Range', 'Listing Type'].map((text, idx) => (
          <div key={idx} className="flex items-center bg-gray-100 h-[50px] px-6 rounded-full shadow-sm cursor-pointer">
            <span className="text-gray-600 text-sm">{text}</span>
            <svg className="ml-2 w-4 h-4 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M19 9l-7 7-7-7" />
            </svg>
          </div>
        ))}
      </div>
    </div>

    {/* Buttons */}
    <div className="flex items-center gap-4">
      <button className="bg-black text-white text-sm font-semibold py-3 px-6 rounded-full">Pull Data</button>
      <button className="bg-black text-white text-sm font-semibold py-3 px-6 rounded-full">Save Search</button>
    </div>




        {/* Title */}
        <div className="absolute top-[29px] left-[397px] text-black text-[32px] font-semibold bg-white">
          Search & Compare
        </div>

        {/* Location listings */}
        <div className="absolute top-[188px] left-[397px] text-base font-semibold text-black">
          Madison Seattle Rental Listings
        </div>

        {/* Locations */}
        <div className="flex flex-col w-[1013px] items-center gap-[31px] absolute top-[216px] left-[397px]">
          <Locations />
        </div>


        {/* Sidebar */}
        <SidePanel />


      </div>
    </div>
  );
};
